  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115700 includes chemical,
  discrete sample, physical and profile data collected from KNORR in the South Pacific
  Ocean from 1992-09-01 to 1992-09-15 and retrieved during cruise PACIFICA_316N19920901
  and WOCE_P14C. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE,
  PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
  isotope), WATER DENSITY and WATER TEMPERATURE. The instruments used to collect these
  data include CTD and bottle. These data were collected by Linda Bingler of Battelle
  Marine Sciences Laboratory, Robert M. Key of Princeton University; Department of
  Geosciences; Program in Atmospheric and Ocean Sciences, Dean Roemmich of Scripps
  Institution of Oceanography, Mark Warner of University of Washington and William
  Jenkins of Woods Hole Oceanographic Institution as part of the WOCE_P14C, PACIFICA_316N19920901
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
